INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300150, 5, 1, 2, 2.46, 0, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", "vo_minigame_1012_result_1082", 3, 9, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300151, 5, 1, 2, 2.94, 0, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", "vo_minigame_1012_result_1083", 3, 9, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300152, 5, 1, 3, 4.19, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", "vo_minigame_1012_result_1084", 7, 9, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300153, 5, 1, 3, 0.0, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", "vo_minigame_1012_result_1085", 1, 9, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300154, 5, 1, 3, 2.63, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", "vo_minigame_1012_result_1086", 3, 9, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300155, 1, 1, 1, 5.53, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", "vo_minigame_1012_result_1087", 3, 4, 1);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300156, 1, 1, 1, 0.01, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", "vo_minigame_1012_result_1088", 3, 4, 3);
