INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300158, 1, 1, 2, 0.01, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", "vo_minigame_1012_result_1090", 9, 4, 9);
INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300159, 1, 1, 2, 5.37, 0, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", "vo_minigame_1012_result_1091", 3, 4, 1);
