INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300161, 1, 1, 3, 0.0, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", "vo_minigame_1012_result_1093", 3, 4, 3);
