INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300163, 1, 1, 3, 2.61, 0, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", "vo_minigame_1012_result_1095", 5, 4, 1);
