INSERT INTO `v1_44acab59a07eec64730492b022e1daa2ebfb9b7fc686305f417aefb702b1ad09` VALUES (2, 3001, 12300167, 0, 1, 2, 5.75, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", "vo_minigame_1012_result_1099", 6, 0, 2);
